INSERT INTO BLUADMIN.BILLING_ENTITY ( id, name, billing_code, abn, campaign_code, property_manager, contract_type, subscription_cost, invoice_text, crn_choice, future_subs, is_active, business_address_id, partner_id, created_by, created_date, last_modified_by, last_modified_date) VALUES ('5069', 'Louis Bradley', 'MTS', '1271429077023', 'MTN_North', 'Erik Hawkins', 'INITIAL_SUBSCRIPTION', '142', 'Zizidseh vun ce limvah jaraufu esamuh uz to leadad aw neonis magil bu eg ija. Wom inein me torcic bo pavawvup ru rit tifur peziglat zouviwuj lijsupzo wi batru ta. Hu ecki sa hemcegle vovsi mu tokmec bafhukna raso nunumeer toraeb lit ozeodasib fipzu gu wok esajaflew wuju. Riipihir kovumij ukecup rortime tivaco wav vagdepum neen gouku fim kabapom cihiz ni buwuwo eg huhjuf. Pemzadim mo zopifutog ok zed bo jep si seiju ji pat mi zi atacemzej budaw ujibofi. Gu palo haunju ezi meg peos at icpasad ciranifos ef lej negena ose. Jihpalmij dedod ag taata cupi ho lamemof tiracti penozud tudhe ruwocece kuafu lacrokni otuejaet va.', 'OPTIONAL', '0', '1', '5069', '5019', 'system', '2017-04-07 08:21:28', 'system', '2017-04-07 08:21:28');
